import React from 'react';
import '../Styles/Projects.css';
import CNNup from '../assets/CNN-UpRight.png';
import CNNlaying from '../assets/CNN-LayDown.png';


// import React, { useState } from 'react'

function Projects() {
    // const [projects, setProjects] = useState([
    //     { projectName: ''},
    // ]);

    return (
        <div className="frame">

            <div className="grid-container">
                <div className="grid-item">
                    {/* <div className="project-details"> */}
                    <div className="information-side">
                        <p className="title-of-project">Convolutional<br></br>Neural<br></br>Network</p>
                        <p className="project-from">University Course Work</p>
                        <p className="project-info">Paper proposing possible way to use CNN to identifying structural damage within reinforced concrete using Radiographs, also known as X-rays</p>
                        <p className="project-link">View Paper</p>
                    </div>

                    <div className="project-tags">
                        <p className='title'>Built With:</p>
                        {/* <div className="titles-borders"> */}
                        <p className='tag-titles'>React.js</p>
                        <p className='tag-titles'>HTML</p>
                        <p className='tag-titles'>CSS</p>
                        <p className='tag-titles'>JavaScripts</p>
                        {/* </div> */}
                    </div>

                    {/* </div> */}
                </div>
                <div className="grid-item">
                    {/* <div className="project-images"> */}
                    <img src={CNNup} alt="gitHub" width="50em" height="50em"></img>
                    <img src={CNNlaying} alt="gitHub" width="50em" height="50em"></img>
                    {/* </div> */}
                </div>

            </div>



            <div className="project-tags">    
            </div>
        </div>
    )
}

export default Projects
